import "./Tile.css";
// import pawn_w from "../../public/Pieces/pawn_w.png"

interface props {
  image?: string;
  num: number;
}

const Tile = ({ image, num }: props) => {
  //{X}{y}
  if (num % 2 == 0)
    return (
      <div className="tile black-tile">
        {<div className="tile-piece" style={{backgroundImage:`url(${image})`}}> </div>}
        </div>
    );
  else
    return (
      <div className="tile white-tile">
         <div className="tile-piece" style={{backgroundImage:`url(${image})`}}> </div>
      </div>
    );
};

export default Tile;
